const currenciesLoaded = (currency) => {
	return {
		type: 'FETCH_CURRENCIES_SUCCESS',
		payload: currency
	};
};

const convertibleCurrency = (code, value) => {
	return {
		type: 'CONVERTIBLE_CURRENCY',
		code,
		value
	};
}

const newVal = (v) => {
	return {
		type: 'VAL_2',
		payload: v
	};
}

export {
	currenciesLoaded,
	convertibleCurrency,
	newVal
};
